import axios, {AxiosRequestConfig} from 'axios';
//import { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom'
import { ProjetosService } from 'services/api/Projetos/ProjetosService';

const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();
    const email = (event.target as any).email.value;
    const score = (event.target as any).score.value;

   /*

    const config: AxiosRequestConfig = {
        baseURL: BASE_URL,
        method: 'POST',
        url: '/project',
        data: IDetalheProjeto
    }

    axios(config).then(response =>{
        navigate("/");
    })
    */
}

function Project() {

    return (

        <div className="project-form-container">
            <div className="project-card-bottom-container">
                <h3>Cadastro de Projeto</h3>
                <form className="project-form" onSubmit={handleSubmit}>
                    <div className="form-group project-form-group">
                        <label htmlFor="email">Informe seu email</label>
                        <input type="email" className="form-control" id="email" />
                    </div>
                    <div className="form-group project-form-group">
                        <label htmlFor="score">Informe sua avaliação</label>
                        <select className="form-control" id="score">
                            <option>1</option>
                            <option>2</option>
                            <option>3</option>
                            <option>4</option>
                            <option>5</option>
                        </select>
                    </div>
                    <div className="project-form-btn-container">
                        <button type="submit" className="btn btn-primary project-btn">Salvar</button>
                    </div>
                </form >
                <Link to="/">
                    <button className="btn btn-primary project-btn mt-3">Cancelar</button>
                </Link>
            </div >
        </div >

    )
}

export default Project();
